import React from "react";
import Profil from "./Profil";
import Right from "./Right";
export default function Body(){
    // let [but,change]=useState(<Right />)
    let fun=()=>{
        console.log('hello')
    }
    return (
        <div className="body">
            
            <Right column='4/6' rows='1/6'/>
            
            

            <Profil  info={{
                column:'1' ,
                rows:'1',
                image:'/image/image-waffle-desktop.jpg' ,
                thename:"Waffle",
                discrption:'Waffle with Berries',
                slarey:'$6.50'
            }}/>
            <Profil  info={{
                column:'2' ,
                rows:'1',
                image:'/image/image-creme-brulee-desktop.jpg' ,
                thename:"Crème Brûlée",
                discrption:'Vanilla Bean Crème Brûlée',
                slarey:'$7.00'
            }}/>
            
            <Profil  info={{
                column:'3' ,
                rows:'1',
                image:'/image/image-macaron-desktop.jpg' ,
                thename:"Macaron",
                discrption:'Macaron Mix of Five',
                slarey:'$8.00'

            }}/>
            <Profil  info={{
                column:'1' ,
                rows:'2',
                image:'/image/image-tiramisu-desktop.jpg' ,
                thename:"Macaron",
                discrption:'Macaron Mix of Five',
                slarey:'$8.00'

            }}/>
            <Profil  info={{
                column:'2' ,
                rows:'2',
                image:'/image/image-baklava-desktop.jpg' ,
                thename:"Macaron",
                discrption:'Macaron Mix of Five',
                slarey:'$8.00'

            }}/>
            <Profil  info={{
                column:'3' ,
                rows:'2',
                image:'/image/image-meringue-desktop.jpg' ,
                thename:"Macaron",
                discrption:'Macaron Mix of Five',
                slarey:'$8.00'

            }}/>

             <Profil  info={{
                column:'1' ,
                rows:'3',
                image:'/image/image-meringue-desktop.jpg' ,
                thename:"Macaron",
                discrption:'Macaron Mix of Five',
                slarey:'$8.00'

            }}/>
             <Profil  info={{
                column:'2' ,
                rows:'2',
                image:'/image/image-meringue-desktop.jpg' ,
                thename:"Macaron",
                discrption:'Macaron Mix of Five',
                slarey:'$8.00'

            }}/>
             <Profil  info={{
                column:'3' ,
                rows:'2',
                image:'/image/image-meringue-desktop.jpg' ,
                thename:"Macaron",
                discrption:'Macaron Mix of Five',
                slarey:'$8.00'

            }}/>
            
            

        </div>
    );
}
